import React from 'react';
import './dashboard.css'

const DashBoard = () => {
    return (
        <div className="dashWrapper">
            <div className="sideNavHolder subWrapper"></div>
            <div className="dashBody      subWrapper"></div>
        </div>
    );
}

export default DashBoard;
